import React from "react";
import { NavWhiteCompact } from "../generalFunctionForOnScroll/ScrollEventFor_Homepage";
import { ScrollNavFunction } from "../generalFunctionForOnScroll/ScrollEventFor_MotorPage";
import { FooterGe } from "../generalLayout/footer_test";
import Motor3d from "../generalLayout/motor3d";
import MotorPageHeader from "../generalLayout/motorPageHeader";
import MvEmail from "../generalLayout/mvEmail";
import Nav from "../generalLayout/nav";
import NavDesktop from "../generalLayout/navDesk";
import PageName from "../generalLayout/pageName";

const heroGradientStart = "#777777";
const heroGradientEnd = "#161616";
const dragster800rr_scs_infor = {
  namePage: "Dragster 800 RR SCS",
  price: "20.000",
  nameHeaderTitle: "dragster800rrscs/dragster-rr-scs.svg",
  bgHeaderParallax: "dragster800rrscs/dragster-rr-scs-xl.png",
  manifesto_Arr: ["THE", "SMART", "REBEL"],
  colorBg: `linear-gradient(90deg,${heroGradientStart} 0%,${heroGradientEnd} 100%)`,
  contentHeaderContent:
    "Exuberance and character. Ready to burn the tarmac without breaking a sweat, thanks to the new smart electronic gearbox.",
  Model3ds: [
    {
      link: "dragster800rrscs/original/dragster800rr_scs",
      color:
        "linear-gradient(45deg, rgba(0,0,0,1) 24%, rgba(0,0,0,1) 25%, rgba(56,56,56,1) 55%, rgba(148,148,148,1) 100%)",
      nameOfColor: "MATT MAGNUM AVIO GREY MATT METALLIC DARK GREY",
    },
  ],
};
export default function Dragster800RR_SCS() {
  window.addEventListener("scroll", () => {
    ScrollNavFunction();
    NavWhiteCompact();
  });
  return (
    <>
      <div
        className="nav-pc-homepage"
        style={{ background: dragster800rr_scs_infor.colorBg }}
      ></div>
      <NavDesktop />
      <Nav color="white" />
      <PageName namePage={dragster800rr_scs_infor.namePage} />
      <MotorPageHeader
        manifesto_Arr={dragster800rr_scs_infor.manifesto_Arr}
        nameHeaderTitle={dragster800rr_scs_infor.nameHeaderTitle}
        colorBg={dragster800rr_scs_infor.colorBg}
        contentHeaderContent={dragster800rr_scs_infor.contentHeaderContent}
        price={dragster800rr_scs_infor.price}
        bgHeaderParallax={dragster800rr_scs_infor.bgHeaderParallax}
        reveredContent={false}
        heightContentTop="20%"
        titleSize="auto 21%"
      />
      <Motor3d Models={dragster800rr_scs_infor.Model3ds} />
      <MvEmail />
      <br />
      <FooterGe />
    </>
  );
}
